  03> THOMSON, William James
  b 29.09.1972
  Address: PO Box 1267, Taupo.
  02> THOMSON, Nancy Patricia m on 20.10.1969 to STRATFORD, Warwick
  b 14.03.1944
  b 01.10.1939
  Nancy b. at Westport and m. at Havelock North. Warwick, s/o H Stratford and N Reynolds. Address: 862
  Wily Terrace, Taupo.
  Nancy moved to Hastings with her parents about 1947. She was educated at Mahora School, Queenswood
  School and Marsden School, Wellington (boarder, 1957-60). She did her nurses training at Christchurch
  Hospital, graduating in 1965. After their marriage, she and Warwick ran a sheep and cattle farm at
  Norsewood where Nancy was District Nurse for 10 years. On moving to Palmerston in 1989 she has worked
  as a practice nurse.
  In 1995 Nancy was a crew member on the delivery voyage of the "Edna Kate", a fishing boat purchased by
  sister Min and her partner, Mike Lee, in Japan. Nancy has been living at Acacia Bay, Taupo since
  February 1998.
  01> STRATFORD, Benjamin John
  b 04.05.1972
  Benjamin b. at Dannevirke and educated at Norsewood School and Palmerston North Boys' High School.
  He graduated BAgSc from Massey University in 1994 then spent two years at Williams Lake, Canada,
  working for an irrigation company. On his return to New Zealand he took over the management of a
  pump company in Taupo in 1998.
  02> STRATFORD, Anthony Warwick
  b 05.02.1974
  Anthony b. at Dannevirke and educated at Norsewood School and Palmerston North Boys' High School.
  He completed a building apprenticeship in Palmerston North in 1997 and is now a self-employed
  builder.
  03> STRATFORD, Peter James
  b 24.02.1975
  Peter b. at Dannevirke. He attended Norsewood School and Palmerston North Boys' High School and is
  now completing an MSc(Marine) degree at Otago University.
  04> STRATFORD, Samuel Charles
  b 26.02.1977
  Samuel b. at Dannevirke. He attended Norsewood School and Palmerston North Boys' High School and is
  now completing a NZ Architectural Draughting Certificate at Otago Polytechnic.
